import { Navigate } from "react-router-dom";
import { selectUser } from "../../hooks/authSlice"
import { useSelector } from 'react-redux'

export default function Home () {

  const user = selectUser();

  console.log(user)

  if (!user) {
    return <Navigate to="/login" />;
  }

  return (
    <h1>Home</h1>
  )
}
